import React from 'react';
import {Card} from 'react-bootstrap';

const Idea = ({datos}) => {
  return (
  <div >
      <>
     
        <Card
          bg={'Info'}
          key={'Info'}
          text={'dark'}
          style={{ width: '18rem' }}
          className="mb-2"
        >
          <Card.Header>Header</Card.Header>
          <Card.Body>
            <Card.Title>{'Info'} Card Title </Card.Title>
            <Card.Text>
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </Card.Text>
          </Card.Body>
        </Card>
      
    </>
    <div key={datos._id}>
    <h1>{datos.idea}</h1>
    <h2 className='text-secondary text-opacity-75 fs-5'>Descripcion: {datos.description}</h2>
    <p>Autor: {datos.author.name}</p>
    </div>
  
  </div>
 
    )
}

export default Idea
